import React, { useEffect } from 'react';
import './App.css';
import {Provider} from "react-redux"
import store from './redux'
import TodoList from './TodoList';


export default function App() {

  return (
    <Provider store={store}>
      <div className='App'>
        <TodoList />
      </div>
    </Provider>

  )
}
